import React, { Component } from 'react';

class ProductCard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      recommendations: []
    };
  }

  render() {
    const { recommendations } = this.state;

    const { name, main_image_src, main_image_alt, currency, selling_price } = this.props;
    console.log('Name: ', name);

    return (
      <div className="ProductCard">
        <header className="ListingHeader">
          <h1>{name}</h1>
          <p>{main_image_src}</p>
          <p>{main_image_alt}</p>
          <p>{currency}</p>
          <p>{selling_price}</p>
        </header>
      </div>
    );
  }
}

export default ProductCard;
